script: |
  super -f text -I q9895.spq | sort > q9895.out

inputs:
  - name: q9895.spq
    data: |
      SELECT ALL + + col1 * + col1 * + col1 * + + 87 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( + col0 + - col0 / - + col2 ) > col2 * - ( + col0 );
  - name: tab1

outputs:
  - name: q9895.out
    data: |
